content:
Một căn duy nhất Cầu Giấy 52m 5 tầng 5.4 tỷ
NHÀ ĐẸP VÀO Ở NGAY - 50M Ô TÔ - TRUNG TÂM CẦU GIẤY
- Nhà xây được vài năm, vẫn như mới khách mua ở ngay.
- Ngõ sạch đẹp, xe ba gác vào ra thoải mái.
- Thiết kế: tầng 2 phòng, cầu thang giữa,
- Tầng 1: Để xe, Phòng khách, khu bếp,WC;
- Tầng 2,3,4: Mỗi tầng 2 phòng, WC;
- Tầng 5: Phòng thờ, sân phơi;
- Sổ đỏ riêng, nhà xây vuông vắn.
Giá bán 5.4 tỷ

Nhà Mặt Phố Trung Tâm Quận Hoàng Mai
Diện tích 72m, 6 Tầng, Mặt Tiền 7m
Vị trí đắc địa, kinh doanh tốt, mặt tiền siêu rộng.
Nhà 6 tầng, cực kỳ bề thế,
T1: Ga ra ô tô + xe máy;
T2: Phòng khách, có lối đi riêng + WC;
T3, T4, T5: Mỗi tầng 2 phòng + WC;
T6: Tum + sân phơi.
Sổ đỏ chính chủ. Pháp lý chuẩn giao dịch ngay.
Chi tiết xin liên hệ: Mr. Hưng

NHÀ ĐẸP VÀO Ở NGAY - GẦN Ô TÔ - TRUNG TÂM CẦU GIẤY - CHỈ HƠN 6 TỶ - CÓ THỂ CHUYỂN ĐỔI THÀNH CCMN CHO THUÊ.
DT 40m2 x 5 tầng, mt 4m, 50m ra phố.
Nhà xây KCBT, vẫn như mới khách mua ở ngay, ra phố rất gần. Khu vực dân cư đông đúc, kinh doanh sầm uất.
Ngõ sạch đẹp, xe ba gác vào ra thoải mái, trước nhà rộng thoáng.
Thiết kế nhà 5 tầng: tầng 2 phòng, cầu thang giữa,
- Tầng 1: Để xe, Phòng khách, khu bếp, WC;
- Tầng 2,3,4: Mỗi tầng 2 phòng, WC;
- Tầng 5: Phòng thờ, sân phơi;
Sổ đỏ riêng, chính chủ, nở hậu, pháp lý chuẩn, giao dịch ngay.

